pragma solidity ^0.4.21;

contract ImageStore {

    struct Image {
        bytes32 hash;
        address owner;
    }

    mapping(bytes32 => Image) public images;

    function storeImage(bytes32 _hash, address _owner) public {
        images[_hash] = Image(_hash, _owner);
    }

    function getImage(bytes32 _hash) public view returns (bytes32, address) {
        Image storage image = images[_hash];
        return (image.hash, image.owner);
    }
}
